import { domain } from "../API/api";

const pageApi = {
  home: () => {
    return fetch(`${domain}/elearing/v4/home`).then((res) => res.json());
  },
  course_detail: (slug) => {
    return fetch(`${domain}/elearning/v4/course/${slug}`).then((res) =>
      res.json()
    );
  },
};
export default pageApi;
